import React from "react";
import Header from "../components/header/Header";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div>
        <Header/>
        <p>Welcome to Razzle.</p>
        <Link to="games">Games</Link>
    </div>
  );
};

export default Home;
